    N = 100 - 5
    F = [0] * (n + 5)
    for (l, r) in ranges:
        F[l] += 1
        F[r + 1] -= 1
    DP = [[0 for _ in range(N)] for _ in range(N)]
    for i in range(c):
        DP[i][0] = i
    for j in range(1, N):
        for i in range(1, c):
            cnt = 0
            for l in range(c):
                cnt += DP[i * l % c][j - 1]
            cnt /= c
            DP[i][j] = (cnt + DP[i][j - 1]) / 2
    ans = 0
    for i in range(1, n + 1):
        F[i] += F[i - 1]
        ans += DP[1][F[i]]
    return ans

